Needy (Amanda Seyfried) en Jennifer (Megan Fox) zijn al van kleins af aan beste vriendinnen. Wanneer Jennifer Needy weer eens 
weet over te halen om de avond met haar te spenderen in plaats van met haar vriendje gaan ze naar een kroeg waar de band Low 
Shoulder speelt. Als de kroeg tot de grond toe afbrandt en Needy en Jennifer weten te ontsnappen verandert er iets. In het dorpje 
beginnen steeds meer doden te vallen en Needy moet accepteren wat ze al lang wist: Jennifer is duivels.
